import React from "react";
import Layout from "../components/Layout";
import { Grid } from "@mui/material";

const Login = () => {
  return (
    <>
      <Layout title={"Login Page"}>
        <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
          <Grid item xs={6}>
          </Grid>
          <Grid item xs={6}>
            <Item>2</Item>
          </Grid>
        </Grid>
      </Layout>
    </>
  );
};

export default Login;
